import Paper from '@material-ui/core/Paper';
import {createStyles, makeStyles, Theme} from '@material-ui/core/styles';
import React from 'react';
import AnglePie from './donutChart';
import TinyAreaChart from './TinyAreaChart';
import TineBarChart from './TinyBarChart';
import TinyLineChart from './TinyLineChart';

const tinyLineChartData =
[
  {
    "name": "Page A", "uv": 4000, "pv": 2400, "amt": 2400
  },
  {
    "name": "Page B", "uv": 3000, "pv": 1398, "amt": 2210
  },
  {
    "name": "Page C", "uv": 2000, "pv": 9800, "amt": 2290
  },
  {
    "name": "Page D", "uv": 2780, "pv": 3908, "amt": 2000
  },
  {
    "name": "Page E", "uv": 1890, "pv": 4800, "amt": 2181
  },
  {
    "name": "Page F", "uv": 2390, "pv": 3800, "amt": 2500
  },
  {
    "name": "Page G", "uv": 3490, "pv": 4300, "amt": 2100
  }
]



const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
      '& > *': {
        margin: "38px",
        width: "350px",
        height: "180px",
        paddingTop:"35px",
        borderRadius:"5px"
      },
    },
  }),
);

export default function SimplePaper() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Paper elevation={10}
      style={{
        backgroundColor:"white",
        textAlign: 'center',
        boxShadow: '10px 15px 15px rgba(100,100,255,0.3)',
      }}><TinyLineChart
      tinyLineChartData={tinyLineChartData}/></Paper>

      <Paper elevation={10}
        style={{
        backgroundColor:"white",

        textAlign: 'center',
        boxShadow: '10px 15px 15px rgba(100,100,255,0.3)',
      }}> <TinyAreaChart/></Paper>

<Paper elevation={10}
        style={{
        backgroundColor:"white",

        textAlign: 'center',
        boxShadow: '10px 15px 15px rgba(100,100,255,0.3)',
      }}> <TineBarChart/></Paper>
<Paper elevation={10}
        style={{
        backgroundColor:"white",

        textAlign: 'center',
        boxShadow: '10px 15px 15px rgba(100,100,255,0.3)',
      }}> <AnglePie/></Paper>


    </div>
  );
}
